sources.styles/blockes/contacts.scss:
.contacts {
  &__form {
    display: flex;
    width: 100%;
    max-width: 412px;
    flex-direction: column;
    gap: 16px;
  }

  &__main {
    @include onTablet {
      display: flex;
      gap: 24px;
      justify-content: space-between;
    }

    @include onDesktop {
      gap: 198px;
    }
  }

  &__field {
    display: flex;
    width: 100%;
    height: 48px;

    padding: 14px 0 14px 16px;

    align-items: flex-start;
    border-radius: 40px;
    color: $contact-text-color;
    background: $contact-border-color;
    outline: none;

    border: $contact-border-color;

    &:-webkit-autofill,
    &:-webkit-autofill:hover,
    &:-webkit-autofill:focus {
      -webkit-box-shadow: 0 0 0px 1000px $contact-border-color inset;
    }

    &:hover {
      border: 1px solid $border-color;
      background: $contact-border-color;
      color: $main-text-color;
    }

    &:active {
      border: 1px solid $main-text-color;
      background: $contact-border-color;
      color: $main-text-color;
    }

    &::placeholder {
      color: $contact-text-color;
      font-family: Inter;
      font-size: 14px;
    }
  }

  &__field--message {
    display: flex;
    width: 100%;
    max-width: 412px;
    height: 200px;
    font-family: Inter;

    align-items: flex-start;
    justify-content: left;
    gap: 10px;

    border-radius: 16px;
    resize: none;

    ::-webkit-scrollbar {
        width: 10px;
      }

      ::-webkit-scrollbar-track {
        background: #f1f1f1;
      }

      ::-webkit-scrollbar-thumb {
        background: #888;
      }

      ::-webkit-scrollbar-thumb:hover {
        background: #555;
      }
  }

  &__info {
    display: block;
    width: 100%;
    max-width: 412px;
  }

  &__info--first {
    color: $info-text-color;
    padding-top: 8px;

    margin: 0;
  }

  &__info--second {
    color: $info-text-numbers;
    margin-bottom: 24px;

    @include hover(transform, scale(1.05));
  }

  &__info--number {
    color: $info-text-numbers;
    text-decoration: none;
  }

  &__info--mail {
    color: $info-text-numbers;
    text-decoration: none;
  }

  &__info--address {
    color: $info-text-numbers;
    text-decoration: none;
  }
}

